// Parse ALL LLM outputs → many items (not just the first one)
const inputs = $input.all();
const out = [];

/* ---------- helpers ---------- */

// ดึงข้อความดิบจากโครงสร้าง Gemini หลายรูปแบบ
function collectRawText(obj) {
  if (!obj) return "";

  // กรณี 1: มี content.parts ตรง ๆ
  if (obj?.content?.parts && Array.isArray(obj.content.parts)) {
    return obj.content.parts
      .map(p => p?.text ?? "")
      .filter(Boolean)
      .join("\n");
  }

  // กรณี 2: เป็นโครงสร้าง Gemini เต็ม ๆ ที่มี candidates
  if (Array.isArray(obj?.candidates)) {
    const texts = [];
    for (const c of obj.candidates) {
      if (c?.content?.parts && Array.isArray(c.content.parts)) {
        texts.push(
          ...c.content.parts
            .map(p => p?.text ?? "")
            .filter(Boolean)
        );
      } else if (typeof c?.content?.text === "string") {
        texts.push(c.content.text);
      }
    }
    if (texts.length) return texts.join("\n");
  }

  // กรณี 3: field text ธรรมดา
  if (typeof obj?.text === "string") return obj.text;

  // กรณี 4: ตัวมันเองเป็น string
  if (typeof obj === "string") return obj;

  return "";
}

// ไม่เปลี่ยนข้อความไทยของชื่อ/ที่อยู่/วันที่ แต่ "จำนวนเงิน" ต้องเป็น number
function parseAmountToNumber(value) {
  if (value === null || value === undefined) return null;
  if (typeof value === "number" && Number.isFinite(value)) return value;

  // รับสตริงที่มีคอมมา/ช่องว่าง/สัญลักษณ์เงิน → ตัดออกให้เหลือเฉพาะตัวเลข จุด และลบ
  const s = String(value).replace(/[^\d.\-]/g, "");
  if (!s) return null;
  const n = Number(s);
  return Number.isFinite(n) ? n : null;
}

// บังคับให้ตรง schema (ไม่มีให้เป็น null, จำนวนเงินต้องเป็น number)
// + รองรับ alias key จาก LLM เช่น vendor_vat_id / buyer_vat_id → vendor_vat_id / buyer_vat_id
function coerceToSchema(obj) {
  const working = { ...obj };

  // ---- alias mapping: vat → VAT ----
  // ถ้า LLM ส่ง vendor_vat_id มา แต่ไม่มี vendor_vat_id → copy ไปใช้เป็น vendor_vat_id
  if (working.vendor_vat_id == null && working.vendor_vat_id != null) {
    working.vendor_vat_id = working.vendor_vat_id;
  }
  // เช่นเดียวกันสำหรับ buyer
  if (working.buyer_vat_id == null && working.buyer_vat_id != null) {
    working.buyer_vat_id = working.buyer_vat_id;
  }

  // schema ใหม่ใช้ *_vat_id
  const schemaKeys = [
    "doc_title",
    "invoice_number",
    "date_raw",
    "vendor_name",
    "vendor_vat_id",
    "vendor_branch",
    "buyer_name",
    "buyer_vat_id",
    "buyer_branch",
    "buyer_address_raw",
    "net_amount",
    "vat_amount",
    "grand_total",
  ];

  const result = {};

  for (const k of schemaKeys) {
    // จำนวนเงินไปจัดการทีหลัง
    if (k === "net_amount" || k === "vat_amount" || k === "grand_total") continue;

    if (Object.prototype.hasOwnProperty.call(working, k)) {
      let v = working[k];

      if (v === null || v === undefined) {
        result[k] = null;
      } else if (typeof v === "string") {
        // ตัด \n \r \t ทั่วไปออก (ยุบเป็น space)
        v = v.replace(/[\n\r\t]+/g, " ");

        // address ให้เป็นบรรทัดเดียว
        if (k === "buyer_address_raw") {
          v = v.replace(/\s*\n\s*/g, " ");
        }

        result[k] = v.trim();
      } else {
        // บังคับ cast เป็น string สำหรับ field ที่ไม่ใช่ number
        result[k] = String(v).trim();
      }
    } else {
      result[k] = null;
    }
  }

  // บังคับจำนวนเงินเป็น number หรือ null
  result.net_amount  = parseAmountToNumber(working.net_amount);
  result.vat_amount  = parseAmountToNumber(working.vat_amount);
  result.grand_total = parseAmountToNumber(working.grand_total);

  // default branch: ถ้าไม่มี หรือเป็น string ว่าง → "สำนักงานใหญ่"
  if (!result.vendor_branch) {
    result.vendor_branch = "สำนักงานใหญ่";
  }
  if (!result.buyer_branch) {
    result.buyer_branch = "สำนักงานใหญ่";
  }

  return result;
}

/* ---------- main ---------- */

for (let i = 0; i < inputs.length; i++) {
  const item = inputs[i];

  // ดึง raw text จากโครงสร้าง Gemini (candidates / content / parts)
  const rawOutput = collectRawText(item.json);
  const trimmed = (rawOutput ?? "").toString().trim();

  // 1) ดึงบล็อกโค้ดแบบ fenced: ```json ...``` หรือ ``` ...```
  let jsonBlocks = [];
  const reJson = /```json\s*([\s\S]*?)```/gi;
  const reAny  = /```(?!json)([\s\S]*?)```/gi;
  let m;

  while ((m = reJson.exec(trimmed)) !== null) jsonBlocks.push(m[1].trim());
  while ((m = reAny.exec(trimmed))  !== null) jsonBlocks.push(m[1].trim());

  // 2) ถ้าไม่พบ fenced แต่เนื้อทั้งก้อนเป็น JSON ดิบ
  if (jsonBlocks.length === 0) {
    const t = trimmed;
    if ((t.startsWith("{") && t.endsWith("}")) || (t.startsWith("[") && t.endsWith("]"))) {
      jsonBlocks = [t];
    }
  }

  if (jsonBlocks.length === 0) {
    out.push({
      json: {
        error: "JSON block not found",
        raw_output_preview: trimmed.slice(0, 400),
      },
      pairedItem: { item: i },
    });
    continue;
  }

  // 3) parse ทุก block ที่เจอ
  for (const js of jsonBlocks) {
    try {
      const parsed = JSON.parse(js);

      if (Array.isArray(parsed)) {
        // กรณี LLM ส่ง array ของหลายเอกสาร
        for (const o of parsed) {
          const coerced = coerceToSchema(o ?? {});
          out.push({ json: coerced, pairedItem: { item: i } });
        }
      } else {
        const coerced = coerceToSchema(parsed ?? {});
        out.push({ json: coerced, pairedItem: { item: i } });
      }

    } catch (e) {
      out.push({
        json: {
          error: "JSON parse error",
          snippet: js.slice(0, 300),
          message: e.message,
        },
        pairedItem: { item: i },
      });
    }
  }
}

return out;

const itemsIn = $input.all();
const out = [];

// ใช้ normalizeSpaces เหมือนเดิม
function normalizeSpaces(s) {
  if (s == null) return s;
  return String(s)
    .replace(/[\u200B\u200C\u200D\u2060]/g, "")
    .replace(/\s+/g, " ")
    .trim();
}

/** ดึงหัวเอกสารที่ “น่าจะเป็น” ชื่อเรื่องจริงจาก candidates */
function inferDocTitle(candidates) {
  const titles = candidates
    .map(v => normalizeSpaces(String(v)))
    .filter(Boolean);

  // เรียงลำดับความสำคัญของชื่อเรื่องที่พบบ่อย
  const ORDERED_PATTERNS = [
    /ใบกำกับภาษีอย่างย่อ/i,
    /สำเนา\s*ใบกำกับภาษี/i,
    /ใบกำกับภาษี/i,
    /ใบเสร็จรับเงิน/i,
  ];

  for (const pat of ORDERED_PATTERNS) {
    const hit = titles.find(t => pat.test(t));
    if (hit) return hit;
  }
  // ถ้าไม่เจอ pattern ใดๆ ให้คืนค่าผู้สมัครตัวแรกเพื่อแสดง trace
  return titles[0] ?? null;
}

/**
 * ตรวจประเภทเอกสารว่าเป็น "ใบกำกับภาษี" ที่ใช้ได้ไหม (full vat invoice)
 * กติกา:
 * - มี "ใบกำกับภาษี" และ **ไม่มี** "อย่างย่อ" / "สำเนา" / "copy" ⇒ ใช้ได้
 * - มี "ใบกำกับภาษีอย่างย่อ" / "สำเนาใบกำกับภาษี" / "สำเนา" / "copy" / "ใบเสร็จรับเงิน" อย่างเดียว ⇒ ไม่ใช้ได้
 */
function detectInvoiceStatus(target) {
  if (!target || typeof target !== "object") return target;

  const candidates = [
    target.document_type,
    target.doc_type,
    target.doc_title,
    target.title,
    target.header,
    target.header_title,
  ].filter(v => v != null && v !== "");

  if (candidates.length === 0) {
    // ไม่มีข้อมูลชื่อเอกสารให้ตรวจ
    target.has_invoice = false;
    target.invoice_reason = "ไม่พบหัวเอกสาร (doc title)";
    return target;
  }

  const combinedNorm = normalizeSpaces(
    candidates.map(v => String(v)).join(" ")
  );
  const combined = combinedNorm.toLowerCase();

  // ช่วยระบุหัวเอกสารที่เจอจริงๆ (ไม่ทับของเดิม)
  const inferred = inferDocTitle(candidates);
  if (!target.doc_title && inferred) {
    target.doc_title_inferred = inferred; // เก็บไว้เป็นหลักฐาน ไม่ไปแก้ doc_title เดิม
  }

  // สัญญาณ “ไม่ใช้ได้”
  const isShort = /ใบกำกับภาษีอย่างย่อ/.test(combined);
  const isCopy  = /(สำเนา\s*ใบกำกับภาษี|^|\s)สำเนa?(\s|$)|\bcopy\b/.test(combined); // ครอบคลุม "สำเนาใบกำกับภาษี", "สำเนา", "copy"
  const isReceiptOnly = /ใบเสร็จรับเงิน/.test(combined) && !/ใบกำกับภาษี/.test(combined);

  // สัญญาณ “เป็นใบกำกับ”
  const hasvatInvoiceWord = /ใบกำกับภาษี/.test(combined) || /vat\s*invoice/i.test(combined);

  const hasInvoice = hasvatInvoiceWord && !(isShort || isCopy || isReceiptOnly);
  target.has_invoice = hasInvoice;

  if (!hasInvoice) {
    if (isShort) {
      target.invoice_reason = "เป็น 'ใบกำกับภาษีอย่างย่อ'";
    } else if (isCopy) {
      target.invoice_reason = "เป็น 'สำเนา' หรือ 'copy'";
    } else if (isReceiptOnly) {
      target.invoice_reason = "เป็น 'ใบเสร็จรับเงิน' ไม่ใช่ใบกำกับภาษี";
    } else if (!hasvatInvoiceWord) {
      target.invoice_reason = "ไม่พบคำว่า 'ใบกำกับภาษี'/'vat Invoice'";
    } else {
      target.invoice_reason = "มีสัญญาณไม่ครบสำหรับใบกำกับภาษีเต็มรูป";
    }
  } else {
    target.invoice_reason = "";
  }

  return target;
}

/* ---------- main ---------- */
for (const it of itemsIn) {
  const obj = { ...it.json };
  detectInvoiceStatus(obj);
  out.push({ json: obj, pairedItem: it.pairedItem });
}

return out;

// Code Node: Validate VAT amounts (TH) — improved

// ===== helpers =====
const THAI_DIGITS = "๐๑๒๓๔๕๖๗๘๙";
function toWesternDigits(s){ return String(s ?? "").replace(/[๐-๙]/g, d => String(THAI_DIGITS.indexOf(d))); }
function parseAmount(val){
  if (val === null || val === undefined || val === "") return null;
  let s = toWesternDigits(String(val)).trim();
  let neg = false;
  if (/^\(.*\)$/.test(s)) { neg = true; s = s.slice(1, -1); }
  s = s.replace(/,/g,"").replace(/[^\d.\-]/g,"");
  if (!s) return null;
  const n = Number(s);
  if (Number.isNaN(n)) return null;
  return neg ? -n : n;
}
function toCents(n){ return n==null ? null : Math.round((Number(n)+1e-10)*100); }
function fromCents(c){ return c==null ? null : Number((c/100).toFixed(2)); }

function validateOne(j){
  // อัตรา VAT และ tolerance (สตางค์)
  const rate = parseAmount(j.vat_rate) ?? 0.07;
  const tol  = Number.isFinite(Number(j.tolerance_cents)) ? Number(j.tolerance_cents) : 1; // 1 = 0.01
  const isInclusiveHint = (typeof j.is_inclusive === "boolean") ? j.is_inclusive : null;

  const netC   = toCents(parseAmount(j.net_amount));
  const vatC   = toCents(parseAmount(j.vat_amount));
  const totalC = toCents(parseAmount(j.grand_total));

  const out = {
    amount_ok: false,
    amount_mode: null,           // "exclusive" | "inclusive"
    amount_reason: "",
    vat_rate_used: rate,
    tolerance_cents_used: tol,
    // ค่าที่คำนวณแนะนำ
    fix_suggestion: { net_amount: null, vat_amount: null, grand_total: null },
    net_amount_fixed: null,
    vat_amount_fixed: null,
    grand_total_fixed: null,
  };

  // เทียบค่าภายใน tolerance
  const near = (a,b) => (a!=null && b!=null && Math.abs(a-b) <= tol);

  // ---- exclusive (net เป็นฐาน) ----
  let ex_netC=null, ex_vatC=null, ex_totalC=null;
  if (netC!=null) {
    ex_netC = netC;
    ex_vatC = Math.round(netC * Number(rate));
    ex_totalC = ex_netC + ex_vatC;
  } else if (totalC!=null && vatC!=null) {
    ex_netC = totalC - vatC;
    ex_vatC = vatC;
    ex_totalC = totalC;
  }

  // ---- inclusive (total รวม VAT) ----
  let in_netC=null, in_vatC=null, in_totalC=null;
  if (totalC!=null) {
    in_totalC = totalC;
    in_netC   = Math.round(totalC / (1 + Number(rate)));
    in_vatC   = in_totalC - in_netC;
  } else if (netC!=null && vatC!=null) {
    in_totalC = netC + vatC;
    in_netC   = netC;   // ใช้เพื่อเทียบกรณีไม่มี total
    in_vatC   = vatC;
  }

  const candidates = [];
  if (ex_totalC!=null) candidates.push({mode:"exclusive", netC:ex_netC, vatC:ex_vatC, totalC:ex_totalC});
  if (in_totalC!=null) candidates.push({mode:"inclusive", netC:in_netC, vatC:in_vatC, totalC:in_totalC});

  if (candidates.length === 0) {
    out.amount_reason = "ข้อมูลไม่พอคำนวณ (ต้องมี net หรือ total อย่างน้อย)";
    return out;
  }

  // ให้คะแนน + bias จาก is_inclusive หากผู้ใช้ส่ง hint มา
  let best = null, bestScore = -1, bestDiff = "";
  for (const c of candidates) {
    let score = 0;
    if (netC   == null || near(c.netC,   netC))   score++;
    if (vatC   == null || near(c.vatC,   vatC))   score++;
    if (totalC == null || near(c.totalC, totalC)) score++;

    // bias ตาม hint
    if (isInclusiveHint === true  && c.mode === "inclusive") score += 0.5;
    if (isInclusiveHint === false && c.mode === "exclusive") score += 0.5;

    const diffs = [];
    if (netC   != null && !near(c.netC,   netC))   diffs.push(`net: expected ${fromCents(c.netC)} ≠ given ${fromCents(netC)}`);
    if (vatC   != null && !near(c.vatC,   vatC))   diffs.push(`vat: expected ${fromCents(c.vatC)} ≠ given ${fromCents(vatC)}`);
    if (totalC != null && !near(c.totalC, totalC)) diffs.push(`total: expected ${fromCents(c.totalC)} ≠ given ${fromCents(totalC)}`);

    if (score > bestScore) { bestScore = score; best = c; bestDiff = diffs.join("; "); }
  }

  // สรุปผล
  const allGivenOk =
    (netC   == null || near(best.netC,   netC)) &&
    (vatC   == null || near(best.vatC,   vatC)) &&
    (totalC == null || near(best.totalC, totalC));

  out.amount_ok = allGivenOk;
  out.amount_mode = best.mode;
  out.fix_suggestion = {
    net_amount: fromCents(best.netC),
    vat_amount: fromCents(best.vatC),
    grand_total: fromCents(best.totalC),
  };
  out.amount_reason = allGivenOk ? "" : (bestDiff || "ค่าที่ให้มาไม่สอดคล้องตามอัตราภาษี");
  out.net_amount_fixed   = out.fix_suggestion.net_amount;
  out.vat_amount_fixed   = out.fix_suggestion.vat_amount;
  out.grand_total_fixed  = out.fix_suggestion.grand_total;

  return out;
}

// ===== main =====
const itemsIn = $input.all();
const out = [];
for (const it of itemsIn) {
  const j = { ...(it.json || {}) };
  const v = validateOne(j);

  out.push({
    json: {
      ...j,
      amount_ok: v.amount_ok,
      amount_mode: v.amount_mode,
      amount_reason: v.amount_reason,
      vat_rate_used: v.vat_rate_used,
      tolerance_cents_used: v.tolerance_cents_used,
      net_amount_fixed: v.net_amount_fixed,
      vat_amount_fixed: v.vat_amount_fixed,
      grand_total_fixed: v.grand_total_fixed
    },
    pairedItem: it.pairedItem
  });
}
return out;

