const out = [];

/* ========= helpers ========= */

// แปลงเลขไทย → อารบิก
const THAI_DIGITS = "๐๑๒๓๔๕๖๗๘๙";
function toWesternDigits(str) {
  if (!str) return str;
  return String(str).replace(/[๐-๙]/g, d => String(THAI_DIGITS.indexOf(d)));
}
function onlyDigits(s){ return String(s ?? "").replace(/\D/g, ""); }

// เดือนภาษาไทย → ตัวเลข
const THAI_MONTHS = {
  "มกราคม": "01", "กุมภาพันธ์": "02", "มีนาคม": "03", "เมษายน": "04",
  "พฤษภาคม": "05", "มิถุนายน": "06", "กรกฎาคม": "07", "สิงหาคม": "08",
  "กันยายน": "09", "ตุลาคม": "10", "พฤศจิกายน": "11", "ธันวาคม": "12",
};

// ตัด white-space แปลก ๆ และยุบช่องว่าง
function normalizeSpaces(s) {
  if (s == null) return s;
  return String(s)
    .replace(/[\u200B\u200C\u200D\u2060]/g, "") // zero-width
    .replace(/\s+/g, " ")
    .trim();
}

// ตัดช่องว่างรอบ . - / ( )
function stripSpacesAroundPunct(s) {
  if (s == null) return s;
  return String(s).replace(/\s*([.\-\/()])\s*/g, "$1");
}

/** ✅ normalize วันที่ → dd/mm/yyyy (เพื่อการเปรียบเทียบ) */
function normalizeDateRaw(input) {
  if (!input) return input;
  let s = toWesternDigits(String(input)).trim();

  // 1) dd/mm/yyyy หรือ dd-mm-yyyy
  let m = s.match(/^(\d{1,2})[\/\-](\d{1,2})[\/\-](\d{4})$/);
  if (m) {
    let [_, d, mth, y] = m;
    let year = parseInt(y, 10);
    if (year > 2400) year -= 543;
    const day = d.padStart(2, "0");
    const mon = mth.padStart(2, "0");
    return `${day}/${mon}/${year}`;
  }

  // 2) yyyy-mm-dd
  m = s.match(/^(\d{4})-(\d{1,2})-(\d{1,2})$/);
  if (m) {
    let [_, y, mth, d] = m;
    let year = parseInt(y, 10);
    if (year > 2400) year -= 543;
    const day = String(d).padStart(2, "0");
    const mon = String(mth).padStart(2, "0");
    return `${day}/${mon}/${year}`;
  }

  // 3) 1 สิงหาคม 2568
  m = s.match(/(\d{1,2})\s*(\S+)\s*(\d{4})/);
  if (m) {
    let [_, dayStr, monthThai, yearThai] = m;
    const mon = THAI_MONTHS[monthThai];
    if (mon) {
      let year = parseInt(yearThai, 10);
      if (year > 2400) year -= 543;
      const d = dayStr.padStart(2, "0");
      return `${d}/${mon}/${year}`;
    }
  }

  return s; // รูปแบบอื่นๆ คืนค่าเดิม (หลังแปลงเลขไทย)
}

/** ✅ normalize รหัสสาขา → "00000" หรือเลข 5 หลัก (ใช้ได้ทั้ง vendor/buyer) */
function normalizeBranch(value) {
  if (!value) return "00000";
  let s = normalizeSpaces(String(value));

  if (/สำนักงานใหญ่/.test(s) || /Head\s*Office/i.test(s)) return "00000";

  // "สาขา 3" / "branch 12"
  let m = s.match(/(สาขา|branch)[^\d]{0,10}(\d{1,5})/i);
  if (m) return String(m[2]).padStart(5, "0");

  // เก็บเฉพาะตัวเลขท้าย 5 ตำแหน่ง
  const digits = onlyDigits(toWesternDigits(s));
  if (digits) return digits.slice(-5).padStart(5, "0");

  return "00000";
}

/** ✅ normalize ชื่อ (ไทย) — เก็บเนื้อหาเดิม, แค่จัดช่องว่าง/วงเล็บ */
function normalizeThaiName(name) {
  if (!name) return name;
  let s = normalizeSpaces(String(name));
  s = stripSpacesAroundPunct(s);
  return s;
}

/** ✅ normalize เลขผู้เสียภาษี (ไทย→อารบิก + เอาเฉพาะตัวเลข) */
function normalizevatId(vatId){
  if (vatId == null) return vatId;
  const digits = onlyDigits(toWesternDigits(vatId));
  return digits || null;
}

/** ใช้ normalize แบบ field-specific (รองรับ vendor/buyer/*) */
function normalizeByField(field, value) {
  switch (field) {
    case "date_raw":
    case "date":
    case "invoice_date":
      return normalizeDateRaw(value);

    case "vendor_branch":
    case "buyer_branch":
      return normalizeBranch(value);

    case "vendor_name":
    case "buyer_name":
      return normalizeThaiName(value);

    case "vendor_vat_id":
    case "buyer_vat_id":
      return normalizevatId(value);

    default:
      return value;
  }
}

/** ✅ normalize อ็อบเจกต์เอกสาร (single) */
function normalizeInvoiceObject(target) {
  if (!target || typeof target !== "object") return target;

  // วันที่
  if (target.date_raw) {
    target.date_raw = normalizeDateRaw(target.date_raw);
  }

  // ผู้ขาย
  target.vendor_branch = normalizeBranch(target.vendor_branch);
  if (target.vendor_name) target.vendor_name = normalizeThaiName(target.vendor_name);
  if (target.vendor_vat_id != null) target.vendor_vat_id = normalizevatId(target.vendor_vat_id);

  // ผู้ซื้อ (ใหม่)
  if (target.buyer_name) target.buyer_name = normalizeThaiName(target.buyer_name);
  if (target.buyer_vat_id != null) target.buyer_vat_id = normalizevatId(target.buyer_vat_id);
  if (target.buyer_branch != null) target.buyer_branch = normalizeBranch(target.buyer_branch);

  // หมายเหตุ: buyer_address_raw — เก็บตามต้นฉบับเพื่อ audit/diff จงใจ "ไม่ปรับแต่ง"
  // ถ้าต้องการแค่ลบ zero-width/ช่องว่างซ้อน ให้อันคอมเมนต์บรรทัดด้านล่าง:
  // if (target.buyer_address_raw) target.buyer_address_raw = normalizeSpaces(target.buyer_address_raw);

  return target;
}

/** ✅ normalize diffs: ใช้ field เป็นตัวชี้ว่าจะ normalize แบบไหน */
function normalizeDiffsArray(diffsArr) {
  if (!Array.isArray(diffsArr)) return diffsArr;
  for (const d of diffsArr) {
    const field = d?.field;
    if (!field) continue;
    if (d.hasOwnProperty("excel")) d.excel = normalizeByField(field, d.excel);
    if (d.hasOwnProperty("pdf"))   d.pdf   = normalizeByField(field, d.pdf);
  }
  return diffsArr;
}

/* ========= main ========= */
for (const it of itemsIn) {
  const obj = { ...it.json };

  if (Array.isArray(obj.diffs)) {
    obj.diffs = normalizeDiffsArray(obj.diffs);
  } else {
    normalizeInvoiceObject(obj);
  }

  out.push({ json: obj, pairedItem: it.pairedItem });
}

return out;
